const fs = require("fs");
const path = require("path");

// A tool to convert OpenTibia maps to https://github.com/peonso/opentibia_sprite_pack
// by Peonso
// dependencies https://github.com/Inconcessus/OTBM2JSON
// node --max-old-space-size=4096 convert.js

var start = Date.now();
const otbm2json = require("./OTBM2JSON/otbm2json");

// Specify the input and output directories
const inputDirectory = "input_folder/";
const outputDirectory = "output_folder/";

// Read all files in the input directory
fs.readdir(inputDirectory, (err, files) => {
  if (err) {
    console.error("Error reading input directory:", err);
    return;
  }

  // Process each file
  files.forEach((file) => {
    if (path.extname(file) === ".otbm") {
      const inputFilePath = path.join(inputDirectory, file);
      const outputFilePath = path.join(outputDirectory, file);

      // Read the map data using the otbm2json library
      const mapData = otbm2json.read(inputFilePath);

      // iterating through tiles converting items
      mapData.data.nodes.forEach(function (x) {
        x.features.forEach(function (x) {
          if (x.type !== otbm2json.HEADERS.OTBM_TILE_AREA) return;

          if (x.tiles == undefined) return;

          x.tiles.forEach(function (x) {
            if (
              x.type !== otbm2json.HEADERS.OTBM_TILE &&
              x.type !== otbm2json.HEADERS.OTBM_HOUSETILE
            )
              return;

            if (x.tileid) {
              x.tileid = convertId(x.tileid);
              //removing invalid ids
              if (x.tileid == 6666) {
                delete x.tileid;
              }
            }

            if (x.items) {
              x.items.forEach(function (x) {
                if (x.id) {
                  // TO DO: if mud wall, remove border items
                  x.id = convertId(x.id);
                  //removing invalid ids
                  if (x.id == 6666) {
                    delete x.id;
                  }
                }

                if (x.content) {
                  x.content.forEach(function (x) {
                    x.id = convertId(x.id);
                    if (x.content) {
                      x.content.forEach(function (x) {
                        x.id = convertId(x.id);
                      });
                    }
                  });
                }
              });
            }
          });
        });
      });

      // Write the output to OTBM using the library
      console.log(
        "Finished conversion for " + file + " in " + (Date.now() - start) + "ms. Writing output to " + outputFilePath
      );
      otbm2json.write(outputFilePath, mapData);
    }
  });

  console.log(
    "Total process took less than " +
      Math.ceil((Date.now() - start) / 1000) +
      "s."
  );
});

// Returns an integer between min, max (inclusive)
function getRandomBetween(min, max) {
  return Math.floor(Math.random() * (max - min + 1)) + min;
}

// Return a random element based on a weight
function getWeightedRandom(weights) {
  // Draw a random sample
  var value = Math.random();
  var sum = 0;

  for (var i = 0; i < weights.length; i++) {
    sum += weights[i].weight;
    if (value < sum) {
      return weights[i].id;
    }
  }
  return weights[1].id;
}

